import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
        <div className="App__Aside"></div>
        <div className="App__Form">
          <div className="PageSwitcher">
            <a href="#" className="PageSwitcher__Item" >Login</a>
            <a href="#" className="PageSwitcher__Item PageSwitcher__Item__Active">Sign Up</a>
          </div>

          <div className="FormTitle">
            <a ></a>
          </div>

        </div>

    </div>
  );
}

export default App;
